import React from "react";
import profile from "./assets/profile.jpg";

const aqua = { color: "#56E39F" };
const darkGreen = { color: "#5B6C5D" };
const ocean = { color: "#59C9A5" };
const coffee = { color: "#3B2C35" };

const cardStyle = {
  margin: "40px",
  border: "10px solid ocean",
};

const aboutStyle = {
  backgroundColor: "coffee",
  color: "ocean",
};

function AboutMe() {
  return (
    <div>
      <div className="card" style={cardStyle}>
        <div className="card-header" style={aboutStyle}>
          About Me
        </div>
        <img src={profile} className="card-img-top" alt="Picture of me"></img>
      </div>
    </div>
  );
}

export default AboutMe;
